import React from "react";
import Books from "./pages/Books";
import Detail from "./pages/Detail";
import NoMatch from "./pages/NoMatch";
import Nav from "./components/Nav";
import { BrowserRouter } from "react-router-dom";

// The app will not render correctly until you setup a Route component.
// Refer to the Basic Example documentation if you need to.
// (https://reacttraining.com/react-router/web/example/basic)
function App() {
  return (
    <BrowserRouter>
    <div>
      <Nav />
      <BrowserRouter exact path="/" component={Books} />
      <BrowserRouter exact path="/books" component={Books} />
      <BrowserRouter exact path="*" component={NoMatch} />

      <Switch>
          <BrowserRouter exact path="/">
            <Books />
          </BrowserRouter>
          <BrowserRouter path="/booksh">
            <Redirect to="/will-match" />
          </BrowserRouter>
          <BrowserRouter path="/will-match">
            <WillMatch />
          </BrowserRouter>
          <BrowserRouter path="*">
            <NoMatch />
          </BrowserRouter>
        </Switch>

      <Books />
    </div>
    </BrowserRouter>
  );
}

export default App;
